import React, { useState } from 'react'
import GoogleLogin from 'react-google-login'
import axios from 'axios'

export default function Google() {

    const responseGoogle = (response) => {
        const emailResponse = response.Ot.yu;
    }

    const sendEmail = () => {
        axios({
            method: 'GET',
            url: '/http://localhost:3000/gestionPerso',
            data: {
                email: responseGoogle,
            }
        });
    }
    return (
        <div className='App'>
            <GoogleLogin
                clientId="939765445894-gkfl9fd7gpd2vehkhdp1ju8g7760p2ca.apps.googleusercontent.com"
                render={renderProps => (
                    <button onClick={sendEmail}>GOOGLE</button>
                )}
                buttonText="Login"
                onSuccess={responseGoogle}
                onFailure={responseGoogle}
                cookiePolicy={'single_host_origin'}
                onClick
            />
        </div>
    )
}
